@@ help.html.ep
% layout 'default';
% title 'Hex Describe';
<h1>Hex Describe Help</h1>

<p>
How do you get started writing a table for <em>Hex Describe</em>? This
page is my attempt at writing a tutorial.

<ul>
<li><a href="#basics">The Basics</a></li>
<li><a href="#context">Context</a></li>
<li><a href="#introduction">Introduction</a></li>
<li><a href="#same">Reuse: same</a></li>
<li><a href="#alias">Alias: as</a></li>
<li><a href="#save">No output: save and store</a></li>
<li><a href="#quote">No lookup: quote</a></li>
<li><a href="#indirection">Reuse: indirection</a></li>
<li><a href="#naming_things">Naming Things</a></li>
<li><a href="#naming_features">Naming Features</a></li>
<li><a href="#indirection_again">Reuse: combining indirection and named features</a></li>
<li><a href="#adjacent">Adjacent Hexes</a></li>
<li><a href="#links">Linking to Other Hexes</a></li>
<li><a href="#lists">Lists of unique things: with, and</a></li>
<li><a href="#quests">Simple Quests: here, nearby, other</a></li>
<li><a href="#combining">Combining it: here, save, store</a></li>
<li><a href="#here">Reuse: here, same, and nearby</a></li>
<li><a href="#global">Global values</a></li>
<li><a href="#append">Rearranging the output: append</a></li>
<li><a href="#unique">Unique results</a></li>
<li><a href="#later">Delayed nested lookup: later</a></li>
<li><a href="#capitalization">Capitalization</a></li>
<li><a href="#images">Images</a></li>
<li><a href="#files">Static Files</a></li>
<li><a href="#maps">Map Generation</a></li>
<li><a href="#stats">Statistics</a></li>
</ul>

<h2 id="basics">The Basics</h2>

<p>
First, let’s talk about random tables to generate text. <a class="url
http outside" href="http://random-generator.com/">Abulafia</a> uses
the following format:

<ol>
  <li>each table starts with a semicolon and the name of the table</li>
  <li>each entry starts with a number, a comma and the text</li>
</ol>

<p>
Anything else is ignored. Feel free to leave comments all over the
place.

<p>
Let’s write a table for some hills.

%= example begin
;hills
1,The hills are covered in trees.
1,An *orc* tribe is camping in a ruined watch tower.
% end

<p>
Note how we use asterisks for bold. You can use HTML directly, too.

<p>
You can test it by picking the <%= link_to 'No Map' => 'nomap' %>
link, using <code>[hills]</code> as your text and the above as your
table. Reload it a few times, or just repeat it a few times:
<code>[hills] [hills] [hills] [hills]</code>.

<p>
If we use the above table to generate random text, then half the hills
will be covered in trees and the other half will be covered in orc
infested watch tower ruins. What we want is for orcs to be rare. We
can simply make the harmless entry more likely:

%= example begin
;hills
5,The hills are covered in trees.
1,An *orc* tribe is camping in a ruined watch tower.
% end

<p>
Now five in six hills will be harmless.

<p>
We could have chosen a different approach, though. We could have
written more entries instead.

%= example begin
;hill
1,The hills are covered in trees.
1,Many small creeks separated by long ridges make for bad going in these badlands.
1,An *orc* tribe is camping in a ruined watch tower.
% end

<p>
Now every line has a one in three chance of being picked. I like
almost all the hexes to have lairs in them. In my game, people can
still travel through these regions with just a one in six chance of an
encounter. That’s why I’m more likely to just write a table like this:

%= example begin
;hill
1,Many small creeks separated by long ridges make for bad going in these badlands.
1,An *ettin* is known to live in the area.
1,A *manticore* has taken over a ruined tower.
1,A bunch of *ogres* live in these hills.
1,An *orc tribe* is camping in a ruined watch tower.
% end

<p>
Now only one in five hexes has nothing to offer.

<p>
We can be more specific because we can include dice rolls in square
brackets. So let’s specify how many ogres you will encounter:

%= example begin
;hill
1,Many small creeks separated by long ridges make for bad going in these badlands.
1,An *ettin* is known to live in the area.
1,A *manticore* has taken over a ruined tower.
1,[1d6] *ogres* live in these hills.
1,An *orc tribe* is camping in a ruined watch tower.
% end

<p>
Note that all these rules and table names are case sensitive!

<p>
Then again, it makes me sad when the generated text then says “1
ogres”. It should say “1 ogre!” We can do that by creating a separate
table for ogres. Separate tables come in square brackets, like dice
rolls.

%= example begin
;hill
1,Many small creeks separated by long ridges make for bad going in these badlands.
1,An *ettin* is known to live in the area.
1,A *manticore* has taken over a ruined tower.
1,[1d6 ogres live] in these hills.
1,An *orc tribe* is camping in a ruined watch tower.

;1d6 ogres live
1,An *ogre* lives
5,[1d5+1] *ogres* live
% end

<p>
Now if there are ogres in these hills, there is a one in six chance
for an “ogre” living in these hills and a five in six chance for two
to six “ogres” living in these hills.

<p>
How about we name the most important ogre such that players have an
ogre to talk to?

%= example begin
;hill
1,Many small creeks separated by long ridges make for bad going in these badlands.
1,An *ettin* is known to live in the area.
1,A *manticore* has taken over a ruined tower.
1,[1d6 ogres live] in these hills.
1,An *orc tribe* is camping in a ruined watch tower.

;1d6 ogres live
1,An *ogre* named [ogre] lives
5,[1d5+1] *ogres* led by one named [ogre] live

;ogre
1,Mad Eye
1,Big Tooth
1,Much Pain
1,Bone Crusher
% end

<p>
Again, please note that all these rules and table names are case sensitive!

<p>
As you can see, these three tables can already generate a lot of
different descriptions. For example:

<ol>
<li>An <em>ettin</em> is known to live in the area.</li>
<li>An <em>ogre</em> named Mad Eye lives in these hills.</li>
<li>4 <em>ogres</em> led by one named Big Tooth live in these hills.</li>
</ol>

<p>
Notice how the ogre names are all just two words. How about splitting
them into tables?

%= example begin
;hill
1,Many small creeks separated by long ridges make for bad going in these badlands.
1,An *ettin* is known to live in the area.
1,A *manticore* has taken over a ruined tower.
1,[1d6 ogres live] in these hills.
1,An *orc tribe* is camping in a ruined watch tower.

;1d6 ogres live
1,An *ogre* named [ogre] lives
5,[1d5+1] *ogres* led by one named [ogre] live

;ogre
1,[ogre 1] [ogre 2]

;ogre 1
1,Mad
1,Big
1,Much
1,Bone

;ogre 2
1,Eye
1,Tooth
1,Pain
1,Crusher
% end

<p>
Now we will see such fantastic names as Big Pain, Bone Eye and Mad
Tooth.

<p>
There is actually a shortcut available if you don't plan on reusing something as
a table, and if all the entries are equally likely. It's mostly useful when
doing quick and dirty prototyping: using a vertical line to separate options.

%= example begin
;hill
1,Many small creeks separated by long ridges make for bad going in these badlands.
1,An *ettin* is known to live in the area.
1,A *manticore* has taken over a ruined tower.
1,[1d6 ogres live] in these hills.
1,An *orc tribe* is camping in a ruined watch tower.

;1d6 ogres live
1,An *ogre* named [ogre] lives
5,[1d5+1] *ogres* led by one named [ogre] live

;ogre
1,[Mad|Big|Much|Bone] [Eye|Tooth|Pain|Crusher]
% end

<p>
Note that two vertical lines are read like an "either/or". The first part is
evaluated and if nothing is returned, the second part is evaluated. Use this for
rules stuff like treasure. In the following example, treasure is "either" some
silver and gold "or" some copper (if there was no real treasure to be found).

%= example begin
;pirate treasure
1,[[treasure]||Some copper coins]

;treasure
1,[70% gold] [70% silver]

;70% gold
7,[1d6],000 gp.
3,

;70% silver
7,[1d6],000 sp.
3,
% end

<p>
You can also test for the presence of definitions:

%= example begin
;person
1,This [here name]. [blade?||They carry a [same blade] in their belt.]

;name
1,Alex[store cutlass as blade]
1,Berta
% end

<p>
You can also test for the absence of definitions:

%= example begin
;person
1,This [here name]. [!blade||They look unarmed]

;name
1,Alex[store cutlass as blade]
1,Berta
% end

<p>An expression consisting solely of the characters - + * / % < > = ( ) and 0–9
is resolved like a mathematical expression. In the following example, population
is a number 100–1000 and the chance of them organising a militia is proportional
to that number. So we compare a d1000 roll to the same population number. The
result is either 1 (true) or undefined (false). This allows us to return an
appropriate description.

%= example begin
;village
1,This village of [population] people [organised][militia]

;population
1,[1d10x100]

;organised
1,[[1d1000]<[same population]]

;militia
1,[organised?||has a militia][!organised||has not managed to organise a militia]
% end

<p>
And now you just keep adding. Take a look at the <%= link_to 'Schroeder table'
=> 'schroedertable' %> if you want to see more examples. You might be better off
exploring the <%= link_to url_for('rule_show')->query(load => 'schroeder') =>
begin %>hyperlinked version<% end %> instead, though.

<h2 id="context">Context</h2>

<p>
But now you might be wondering: how does <em>Hex Describe</em> know
which table to use for a map entry like the following?

<pre>
0101 dark-green trees village
</pre>

<p>
<em>Hex Describe</em> will simply try every word. If a table for a
word exists, it will be used. Any of the following will get looked at:

<pre>
;dark-green
;trees
;village
</pre>

<p>
You can have a table describing the <em>trees</em> and a table
describing the <em>village</em>, for example. There's no need to
provide a table for <em>dark-green</em>, here.

<p>
There is more to it than that, however. In a list consisting of
multiple words, the other words provide a <em>context</em>. That is,
if a two-word combo exists, it will be preferred. You could, for
example, write a default table for villages and still have a special
table for villages in a forest.

<pre>
;trees
1,The trees cover the valley floor.

;village
1,There are a bunch of small mud huts, here.

;trees village
1,There is a saw mill and some log cabins, here.
</pre>

<p>
Here's another example. I wanted to provide different tables for
“white mountain” and “light grey mountain”. Just look at the example:

<p>
<img alt="A screenshot of the map" style="width: 100%"
src="data:image/png;base64," />

<p>
The mountains in the bottom left corner at (01.09) and (01.10) just feel
different. I guess you could say that the two swamps in (05.07) and (06.08) also
feel different. In that case you might opt to provide different tables for “grey
swamp” and “dark-grey swamp”. Up to you!

<p>
As far as I am concerned, however, I recommend to start with the following
tables:

<pre>
;water
;mountains
;white mountain
;mountain
;forest-hill
;bushes
;swamp
;trees
;forest
;fir-forest
;firs
;thorp
;village
;town
</pre>

<p>
This will have you covered for all these hexes:

<p>
<img alt="A list of hexes illustrating the list of terrains covered" style="width: 100%"
src="data:image/png;base64," />

<p>
You’re good to go! Write those tables and share them. <img alt=":)" class="smiley" src="data:image/png;base64," />

<p>
If you’re more interested in the <em>Smale</em> maps, I recommend you start with
the following tables:

<pre>
;water
;swamp
;marsh
;desert
;grass
;trees
;forest
;fir-forest
;forest-mountain
;forest-mountains
;forest-hill
;mountain
;hill
;bush
;bushes
;thorp
;village
;town
;large-town
;city
;keep
;tower
;castle
;shrine
;law
;chaos
;fields
</pre>

<p>
And if you want to split them up: instead of “desert” use “sand desert” and
“dust desert”; instead of “fir-forest” use “green fir-forest” and “dark-green
fir-forest”; instead of “hill” use “light-grey hill” and “dust hill”; instead of
“forest-hill” use “light-grey forest-hill” and “green forest-hill”; instead of
“forest-mountains” use “green forest-mountains” and “grey forest-mountains”.

<p>
There is another way for context to play a role. The words used to describe a
hex are stored using the value “1”, so you can test for them. Let’s take an
example where each hex may have the additional tag “fire”, and it influences
many later nested descriptions.

%= example begin
0101 hill fire
0201 hill
0301 hill
0401 hill
include https://campaignwiki.org/contrib/gnomeyland.txt

;hill
1,The rolling hills stretch on forever. [fire?||[burning hills]]

;burning hills
1,On every hilltop is a tower of flames and smoke.
%= end

<p>
In addition to that, words that end in “-” and a number are assigned the numeric
value such that “law-3” assigns the value “3” to the key “law”. See <a
href="#same">reuse</a>, below.

%= example begin
0101 town law-3
0201 town law-0
0301 town law-1
include https://campaignwiki.org/contrib/gnomeyland.txt

;town
1,This is a small town. [constable-[same law]]

;constable-0
1,It is a lawless place.

;constable-1
1,The constable is corrupt. Anything goes.

;constable-2
1,The constable is lazy. Just don’t let them see you.

;constable-3
1,The constable is actively pursuing criminals.
%= end

<h2 id="introduction">Introduction</h2>

<p>
If you want an introduction for your map key, use the <code>TOP</code> rule:

%= example begin
0101 hill
0201 hill
0301 hill
include https://campaignwiki.org/contrib/gnomeyland.txt

;TOP
1,This is the introduction.

;hill
1,The hills are covered in trees.
1,An *orc* tribe is camping in a ruined watch tower.
% end

<p>
You can take advantage of the CSS class <code>sidebar</code> for the
introduction:

%= example begin
0101 hill
0201 hill
0301 hill
include https://campaignwiki.org/contrib/gnomeyland.txt

;TOP
1,This is the introduction.&lt;/p&gt;&lt;p class="sidebar"&gt;And this is the sidebar!

;hill
1,The hills are covered in trees.
1,An *orc* tribe is camping in a ruined watch tower.
% end

<p>
As all the rule results are wrapped in a <code>p</code> element, you need to
make sure that you're closing and opening them correctly in order to generate
valid HTML.

<p>
The introduction would be a good place to set up <a href="#global">global
values</a>.

<p>
There's a similar special table for the end of the text, the <code>END</code>
rule.

<h2 id="same">Reuse: same</h2>

<p>
Any result for a table gets saved locally so that it can get reused in the same
hex. In the following example, <code>[ice monster]</code> results in either a
gorgon or a cryo-hydra. <code>[same ice monster]</code> reuses that to generate
an appropriate second sentence.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green village
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountains
1,[mountain]

;mountain
1,[ice monster lair]

;ice monster lair
1,A *[ice monster]* lives up here. The [same ice monster] is a scourge.

;ice monster
1,gorgon
1,cryo-hydra
% end

<p>
In addition to that, the "hex" key with the current coordinates is always
available as a local. <code>[same hex]</code> returns something like "0101".
</p>

<h2 id="alias">Alias: as</h2>

<p>
Sometimes you are going to generate some stuff and need to refer to it elsewhere
under a different name. In the following example, the monster is either a named
gorgon or a named fate. If you want to reuse just the name, you need to alias
it. The pattern “<em>something</em> as <em>something else</em>” is key, here.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green village
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountains
1,[mountain]

;mountain
1,[monster lair]

;monster lair
1,The [monster] lives up here. Who knows what [same monster name] really wants?

;monster
1,gorgon *[gorgon name as monster name]*
1,fate *[fate name as monster name]*

;gorgon name
1,Stheno
1,Euryale
1,Medusa

;fate name
1,Clotho
1,Lachesis
1,Atropos
% end

<h2 id="save">No output: save and store</h2>

<p>
Sometimes you need to write a lot of things that depend on the results of
previous tables. In order to make this easier, there are two keywords that store
things without producing any output: "save … as …" does a table lookup and
stores it, where as "store … as …" just stores whatever text you give it.
Neither produces output. In the example below, "evil power" is the result of a
table lookup, where as "Thor" is just that, a text that is being stored. Both
"gate" and "statue" can now refer to "same power".

%= example begin
;temple
3,[save evil power as power] This is a ruined temple. [gate] [statue]
1,[store Thor as power] This is a temple. [gate] [statue]

# no temples for Odin and Freya
;good power
1,Odin
1,Freya
1,Thor

;evil power
1,Orcus
1,Set
1,Pazuzu

;gate
1,The gate is inscribed with the *[same power]* rune.

;statue
1,The statue of *[same power]* dominates the courtyard.
% end

<p>
All of this would have been possible without "save" and "store", but it would
have been more difficult and error prone. You would have had to determine
"power" as part of the "gate" table, and then you'd use [same power] in the
"statue" table. But if you then changed the order of [gate] and [statue], you'd
have to remember that. If you did not, then you'd run into the strange problem
that you're using [same power] before using [power]. In order to make this less
likely, determine the important local results beforehand and then write your
actual entries without worrying about the order of things.

<h2 id="quote">No lookup: quote</h2>

<p>
Sometimes you need to print a constant, and you want to store it. But writing
"Thor[store Thor as power]" is cumbersome. Using "quote" simplifiesthis.

%= example begin
;temple
3,This is a ruined temple of [evil power as power]. [gate] [statue]
1,This is a temple of [quote Thor as power]. [gate] [statue]

# no temples for Odin and Freya
;good power
1,Odin
1,Freya
1,Thor

;evil power
1,Orcus
1,Set
1,Pazuzu

;gate
1,The gate is inscribed with the *[same power]* rune.

;statue
1,The statue of *[same power]* dominates the courtyard.
% end

<h2 id="indirection">Reuse: indirection</h2>

<p>
We can use an indirection to generate more specific text.
Let's take the example above and let's use <code>[[same ice monster] lair]</code> to
generate an appropriate lair: <code>[gorgon lair]</code> or <code>[cryo-hydraw
lair]</code>.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green village
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountains
1,[mountain]

;mountain
1,[ice monster lair]

;ice monster lair
1,A *[ice monster]* lives up here. [[same ice monster] lair]

;ice monster
1,gorgon
1,cryo-hydra

;gorgon lair
1,There is an old temple cursed with the presence of a gorgon.

;cryo-hydra lair
1,The glacier up here is the work of a hydra.
% end

<h2 id="naming_things">Naming Things</h2>

<p>
Basically, the idea is that there are some regional things with names
such as factions, dukes, and so on. In the following example I want to
make sure that there are at most three tribes on the map, but I don’t
want to use the same three names for every map. Thus, I need a table
to generate bugbear band names, and there should be at most three of
them.

%= example begin
;forest
1,Under the trees is a little campsite with [1d8 bugbears].

;1d8 bugbears
1,a *bugbear* belonging to the [a bugbear band] band
7,[1d7+1] *bugbears* belonging to the [a bugbear band] band

;a bugbear band
1,[name for a bugbear band1]
1,[name for a bugbear band2]
1,[name for a bugbear band3]

;name for a bugbear band1
1,[bugbear band]

;name for a bugbear band2
1,[bugbear band]

;name for a bugbear band3
1,[bugbear band]

;bugbear band
1,[bugbear band 1] [bugbear band 2]

;bugbear band 1
1,Bear
1,Lynx
1,Cat
1,Wolf

;bugbear band 2
1,Claws
1,Ears
1,Teeth
1,Eyes
% end

<p>
The pattern “name for a <em>thing</em>” (or “name for an <em>other thing</em>”)
is key, here. Whenever a table name matches this pattern, it will determine the
result for the table and keep returning that. Thus, with the tables as they are,
eventually all the bugbear bands will have one of three names as “name for a
bugbear band1-3” are eventually determined.

<p>
An alternative would be to set <a href="#global">global values</a>.

<h2 id="naming_features">Naming Map Features</h2>

<p>
Rivers, trails, canyons, mountains, swamps, forests – all these
things which can stretch over more than one hex can have a name. This
is done by attaching the name to a feature of the hex. Every
neighbouring hex having the same feature also gets this name. Once
again, this relies on tables with a special name: if the table is
called “name for <em>type</em> something” or “name for
<em>type1/type2/type3</em> something” then the result of this table
will apply to all the neighbouring hexes sharing this type.

<p>
Let’s look at an example. The name of the mountain is used for all the
hexes having the "white" feature.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green fir-forest
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountains
1,This is the [name for white big mountains].

;white mountain
1,The air up here is cold. You can see the [name for white big mountains] from here.
1,There is a hidden meadow up here, protected by the [name for white big mountains].
1,A *white dragon* lives in a ruined mountain fortress in the shadow of [name for white big mountains].

;mountain
1,The mountains are steep.

;fir-forest
1,Up here only firs will grow.

;name for white big mountains
1,[dreadful] [peaks]

;dreadful
1,Dire
1,Desert
1,Dead
1,Mourning
1,Giant
1,Sharp
1,Hungry

;peaks
1,Peaks
1,Domes
1,Teeth
1,Giants
1,Domes
1,Mounts
1,Graves
% end

<p>
The key is that the first time the table “name for white big
mountains” is referred to, a name is generated and it will spread to
all the white neighbouring hexes.

<p>
The following rules will generate generate a river name and use it for
the description in all the hexes it flows through. The example has two
rivers.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green fir-forest
0401-0701-0702 river
1101-1401 river
include https://campaignwiki.org/contrib/gnomeyland.txt

;river
1,[name for river] flows through here.
1,[name for river] runs through here.

;name for river
1,[river 1] [river 2]

;river 1
1,Old
1,Long
1,Deep
1,Cold
1,Green
1,Brown

;river 2
1,Creek
1,Waters
1,Stream
% end

<p>
The pattern “name for <em>thing</em>” is key, here. There is no "a"
here when compared to the special rule regarding the naming of things.
Whenever a table has this name, it will determine the result for the
table and save the result for every neighbouring hex with the same
feature. Thus, when the table gets called for these other hexes along
the same line, the same name will be returned.

<p>
A limitation of the current implementation is that when two trails or
two rivers meet in a hex, only one of them will get mentioned.

<h2 id="indirection_again">Reuse: combining indirection and named features</h2>

<p>
In this example, all the hexes forming a mountain range are either
haunted or enchanted. Based on this, the encounters always come from
the appropriate table.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green fir-forest
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountains
1,[mountain]

;mountain
1,This mountain range is [name for mountain/mountains type]: [encounter [name for mountain/mountains type]]

;name for mountain/mountains type
1,haunted
1,enchanted

;encounter haunted
1,ghouls
1,zombies
1,wights

;encounter enchanted
1,an angel
1,a saint
1,a hermit
% end

<h2 id="adjacent">Adjacent Hexes</h2>

<p>
Here's another idea: there is currently an experimental feature whereby
<code>[adjacent hex]</code> picks a random neighbouring hex.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green fir-forest
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountains
1,Here lives a dragon that loves to hunt in [adjacent hex].
% end

<h2 id="links">Linking to Other Hexes</h2>

<p>
What if you want to link to this adjacent hex?

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green fir-forest
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountains
1,Here lives a dragon that loves to hunt in &lt;a href="#desc[name for neighbour]"&gt;[name for neighbour]&lt;/a&gt;.

;name for neighbour
1,[adjacent hex]
% end

<p>
Since the second rule picks a result (and uses it for all the surrounding hexes
which have the feature "neighbour" which is none of them), you can refer to it
multiple times: once for the link target and once for the link text. Yeah, it's
hack. But it works.

<h2 id="lists">Lists of unique things: with, and</h2>

<p>
Sometimes you want to generate lists of unique things, for example a selection
of spells for a scroll should not contain duplicates. Use "with" to start a new
list and use "and" to add items from the same list to it.

%= example begin
;scroll 1
1,[spell 1]
1,[with spell 1], [and spell 1]
1,[with spell 1], [and spell 1], [and spell 1]

;spell 1
1,sleep
1,charm person
1,magic missile
1,read magic
% end

<p>
Any item being added to the list using "and" is picked 10 times. If no match can
be found with 10 attempts, an ellipsis is added instead. In the following
example, the scroll wants four unique spells but the list can only generate
three different results. Clearly, this can't work.
<p>

%= example begin
;impossible scroll
1,[with spell 1], [and spell 1], [and spell 1], [and spell 1]

;spell 1
1,sleep
1,charm person
1,magic missile
% end

<h2 id="quests">Simple Quests: here, nearby, other</h2>

<p>
Here's another idea which you might use to build simple fetch quests and the
like. If a references starts with the word "here" then the result of the table
will get saved. At the very end, when everything is else is done and there is a
reference starts with the word "nearby" then the closest of these saved items
will get used; and if there is a reference starts with the word "other" then
some other of these saved items will get used.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green village
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountain
1,The [here ingredient] grows up here, if you know where to look.
1,There is a [here moongate]. It connects to another [other moongate].

;mountains
1,[mountain]

;fir-forest
1,A forest grows up here.

;moongate
1,moongate

;village
1,The village alchemist is looking for [nearby ingredient].

;ingredient
1,Edelweiss
1,Snow Lilly
1,Ice Devil
% end

<p>
Or more complicated, with types of ingredients.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green village
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountain
2,It's cold up here.
1,The [here mountain ingredient] grows up here, if you know where to look.

;mountains
1,[mountain]

;fir-forest
1,The [here forest ingredient] grows up here, if you know where to look.

;village
1,The village alchemist is looking for [ingredient].

;mountain ingredient
1,Edelweiss
1,Snow Lilly
1,Ice Devil

;forest ingredient
1,Blue Worm
1,Fey Moss
1,Magic Mushroom

;ingredient
1,[nearby mountain ingredient]
1,[nearby forest ingredient]
% end

<p>
Beware: If you start a reference with the word "nearby" then what follows has to
be the thing that was saved using references starting with the word "here". In
the example above, <code>[here forest ingredient]</code> matches <code>[nearby
forest ingredient]</code>. The following wouldn't work and it would be hard to
spot:

<pre>
;village
1,The village alchemist is looking for [nearby ingredient].

;ingredient
1,[mountain ingredient]
1,[forest ingredient]
</pre>

<p>
The problem is that it never says <code>[here ingredient]</code> anywhere, so
nothing is ever found, which means that a random ingredient will get picked.
Thus, it <em>looks</em> as if it worked because a random ingredient is picked,
but it doesn't prefer ingredients that were actually used on the map. You might
just as well have written <code>The village alchemist is looking for
[ingredient].</code>

<p>
Remember: "nearby X" and "here X" must match up.

<h2 id="combining">Combining it: here, save, store</h2>

The keyword "here" can be combined with "save" and "store". In the following
example, half the temples are dedicated to a Greek god and the other half are
dedicated to Heracles. Since he's not a god, we're simply using "here store
Heracles as temple" to store the name "Heracles" as a temple location on the
map, and thus half the time pilgrims will be looking for a Heracles temple.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green village
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountain
1,Here stands a temple of *[here power as temple]*.
1,Here stands a temple of *Heracles*.[here store Heracles as temple]

;mountains
1,[mountain]

;power
1,Zeus
1,Hera
1,Apollo
1,Athena

;village
1,The inn houses a pilgrim looking for the temple of *[other temple]*.
% end

<h2 id="here">Reuse: here, same, and nearby</h2>

<p>
We said that if a references starts with the word "here" then the result of the
table will get saved. What follows is an example where we use "here" and "same"
and "nearby" and nested references to pull it all together.

%= example begin
0101 light-grey mountain
0201 white mountain
0301 white mountains
0401 white mountain
0501 light-grey mountain
0601 light-green fir-forest
0701 light-green fir-forest
0801 light-grey mountain
0901 white mountain
1001 white mountains
1101 white mountain
1201 light-grey mountain
1301 light-green village
include https://campaignwiki.org/contrib/gnomeyland.txt

;mountains
1,[white mountain]

;white mountain
1,[ice monster lair]

;ice monster lair
1,A *[here ice monster]* lives up here. [[same ice monster] lair]

;ice monster
1,gorgon
1,cryo-hydra

;gorgon lair
1,There is an old temple cursed with the presence of a gorgon.

;cryo-hydra lair
1,The glacier up here is the work of a hydra.

;village
1,The village alchemist is looking for the horn of a [nearby ice monster].
% end

<h2 id="global">Global values</h2>

<p>
Sometimes you want to establish some sort of fact and access it from everywhere.
This can be achieved by <a href="#naming_things">naming things</a>. But you
could also do it using the rules mentioned previously: "save", "store", "quote"
and regular lookups, if you use the "global" modifier.

<p>
In the following example, we establish a conflict between two rulers in the <a
href="#introduction">introduction</a>. The names are picked using the <a
href="#naming_things">naming things</a> pattern, but the colour that goes along
with each ruler is stored globally using "global store <em>something</em> as
<em>something else</em>".

%= example begin
0101 green grass village
0201 green grass
0301 green grass village
0401 green grass
0501 green grass village
0601 green grass
0701 green grass village
0801 green grass
0901 green grass village
1001 green grass
1101 green grass village
1201 green grass
1301 green grass village
include https://campaignwiki.org/contrib/gnomeyland.txt

;TOP
1,In this land, [ruler 1] is fighting [ruler 2].

;ruler 1
1,[ruler description] [name for a ruler 1][global store [with colour] as colour 1]

;ruler 2
1,[ruler description] [name for a ruler 2][global store [and colour] as colour 2]

;village
1,In this village, [same colour 1] flags show the locals support [name for a ruler 1].
1,In this village, [same colour 2] flags show the locals support [name for a ruler 2].

;ruler description
1,sad
1,cruel
1,unhappy
1,weak

;name for a ruler 1
1,[with ruler]

;name for a ruler 2
1,[and ruler]

;ruler
1,[title for a man] [name for a man]
1,[title for a woman] [name for a woman]

;title for a man
1,Lord
1,Duke
1,King

;title for a woman
1,Lady
1,Duchess
1,Queen

;name for a man
1,John
1,Richard
1,Henry

;name for a woman
1,Elizabeth
1,Mary
1,Anne

;colour
1,red
1,orange
1,yellow
1,green
1,indigo
1,blue
1,purple

;grass
1,The grass is green.
1,The grass is very green.
% end

<h2 id="append">Rearranging the output: append</h2>

<p>
Sometimes we're deep into a nested table and we want to introduce a few more
paragraphs, but we really don't want to have it right here, just somewhere
further down the line, at the end of the current hex.

<p>
In the following example, there are villages, villages have temples, and
sometimes, these temples have a monster lair beneath them. We don't want this
little dungeon to appear in the middle of the village description, however.

%= example begin
0101 green grass
0201 green grass
0301 green grass village
0401 green grass
0501 green grass
0601 green grass
0701 green grass
0801 green grass
0901 green grass village
1001 green grass
1101 green grass
1201 green grass
1301 green grass
include https://campaignwiki.org/contrib/gnomeyland.txt

;TOP
1,This is the example land.

;grass
1,The land is flat.

;village
1,A village was built here, long ago. At it's center stands a [temple of [power]]. [more]

;more
1,The local believe that it is the favour of [same power] that protects them from their neighbours.

;power
1,Odin
1,Thor

;temple of Odin
1,A temple of Odin[append dungeon]

;temple of Thor
1,A temple of Thor[append dungeon]

;dungeon
1,&lt;p&gt;Beneath the temple of [same power] the ancients built a deadly maze.
%end

<h2 id="unique">Unique results</h2>

<p>
For unique results, use a count of 0. It gets treated as a count of 1 until it
is picked. In the following example, thief Brenda can only be in one of the
villages. Remember, though: a unique result must not necesarily make an
appearance. It will simply appear no more than once – not exactly once!

%= example begin
0101 green grass village
0201 green grass
0301 green grass village
0401 green grass
0501 green grass village
0601 green grass
0701 green grass village
0801 green grass
0901 green grass village
1001 green grass
1101 green grass village
1201 green grass
1301 green grass village
include https://campaignwiki.org/contrib/gnomeyland.txt

;grass
1,The grass is green.

;village
1,This is an ordinary village.
0,This is village is where thief Brenda is hiding!
%end

<h2 id="later">Delayed nested lookup: later</h2>

<p>
We can make this even more elaborate, by delaying nested lookups. Here's the use
case: we want to create fetch quests for relics from nearby temples. Since we
want nearby temples we already know that we'll be using "nearby" to delay the
lookup of the temple. In addition to that, though, we need to delay the lookup
of our relic, if we want the relic to match the temple!

%= example begin
0101 law
0201 law
0301 empty
0401 empty
0501 empty
0601 village
0701 empty
0801 empty
0901 empty
1001 empty
1101 empty
include https://campaignwiki.org/contrib/gnomeyland.txt

;law
1,Here stands a temple of [here power].

;power
1,Thor
1,Odin

;village
1,The priest is looking for a [relic].

;relic
1,[later relic of [nearby power]]

;relic of Thor
1,hammer of Thor

;relic of Odin
1,eye patch of Odin
% end

<h2 id="capitalization">Capitalization</h2>

<p>
Normally, case is unaffected. When you generate names by smashing words
together, and you can't always say which table comes first, then you need
capitalization. In the following example, <em>elvish word</em> can be either
in the middle of a name or at the beginning, so its capitalization varies.

%= example begin
;elf
1,[capitalize elvish prefix][elvish word][elvish suffix]
1,[capitalize elvish word][elvish suffix]

;elvish prefix
1,al

;elvish word
1,thaur

;elvish suffix
1,ion
% end

<p>
There are various special rules regarding capitalization:

<ul>
<li><code>capitalize</code> capitalizes the first character only</li>
<li><code>titlecase</code> capitalizes every word</li>
<li><code>highlightcase</code> capitalizes every word except that
    <em>trivial</em> words are not capitalized</li>
</ul>

Actually, there's a special function to normalize elvish... That's how much of a
nerd I am.

%= example begin
;elf
1,[normalize-elvish [elvish prefix][elvish word][elvish suffix]]
1,[normalize-elvish [elvish word][elvish suffix]]

;elvish prefix
1,al

;elvish word
1,thaur

;elvish suffix
1,ion
% end

<h2 id="images">Images</h2>

<p>
The default tables of <em>Hex Describe</em> use the <a
href="https://campaignwiki.org/face">Face Generator</a> to generate
faces.

<p>
The default table has the following entry:

<pre>
;human
1,[man]&lt;img src="[[redirect https://campaignwiki.org/face/redirect/alex/man]]" alt=""/&gt;
1,[woman]&lt;img src="[[redirect https://campaignwiki.org/face/redirect/alex/woman]]" alt="" /&gt;
</pre>

<p>
As HTML gets passed through during processing, a <em>span</em> element with the
<em>image</em> class is added around every image. That makes it easy to refer to
all the images in the CSS. The CSS then sizes the faces floats the images to the
left.

<p>
The construct <code>[[redirect URL]]</code> should work for any web
service that redirects to its result. Instead of following the
redirect and retrieving the image, the construct just inserts the new
location into the output. This makes sure that you can save the
description to a file, reload it in the future, and you’ll still get
the same faces.

<p>
In practice I think this will be hard for services not hosted on the
same domain since <em>campaignwiki.org</em> is secured by HTTPS and I
think most browsers will then refuse to load resources such as images
from services that aren’t hosted on the same domain
(<a href="https://en.wikipedia.org/wiki/Same-origin_policy">same-origin policy</a>).

<h2 id="files">Files</h2>

<p>
This section is for people running the <em>Hex Describe</em> server.

<p>
You can change the CSS of the site as follows:

<ol>
<li>create a <code>public</code> directory in the same directory where
<code>hex-describe</code> is</li>
<li>create a <code>hex-describe.css</code> in the new directory
</ol>

<p>
The new file takes precedence over the file that came included in the script's
<code>__DATA__</code> section.

<h2 id="maps">Map Generation</h2>

<p>
If you load a random map, it is generated using
<a href="https://campaignwiki.org/text-mapper/">Text Mapper</a>.
I'd be happy to add more map generating algorithms to it. If you have a
procedure involving some tables and dice that generates a good looking map, let
me know! The first such algorithm I saw online, and which I then implemented as
the <em>Smale</em> algorith, was
<a href="https://www.welshpiper.com/hex-based-campaign-design-part-1/">Hex-based Campaign Design</a>
by <a href="https://www.welshpiper.com/">The Welsh Piper</a>.

<h2 id="stats">Statistics</h2>

<p>
If you're interested in the statistics of the generated mini-setting, the
%= link_to Stats => 'statsrandomalpine'
page gives you some statistics for the <em>Alpine</em> algorithm and the
<em>Schroeder</em> tables. It counts all the terrain types generated by the map,
and all the bold texts (supposedly these are the monsters).

